def pollard\_rho(n):
if n == 1:
return []
x, y, d, i = 2, 2, 1, 0
while d == 1:
i += 1
x, y = (x \* x - 1) % n, (x \* x - 1) % n, gcd(abs(x - y), n)
if y == 0 or y == 1 or y == n - 1:
continue
while y != 1:
y = (y \* y - 1) % n
d = gcd(abs(x - y), n)
if d > 1:
return pollard\_rho(d) + [n // d]
return [n]

